INSERT INTO `others` (`id`, `type`, `description`, `others`, `created_at`, `updated_at`) VALUES
(5, 'who_we_are', '<h1 class=\"text-center text-italic\" style=\"margin-right: 0px; margin-left: 0px; font-size: 33px; font-family: Calibri, Helvetica, sans-serif; line-height: 1.2;\"><font color=\"#bd9400\">Who We are</font></h1><p><b>We have more than 22 years of experience\r\nin the garments arena.\r\n</b></p><p><b>RIZQ Sourcing</b> is diversified into more than seven\r\ndifferent business areas. These include Fashion Trade,\r\nRMG, Buying, Logistic, Automobiles.</p><p>\r\nAs Bangladeshi leading apparel sourcing solutions\r\nprovider, we have helped global brands build and grow\r\ntheir businesses out of the&nbsp;<span style=\"font-family: sans-serif; font-size: 14px; font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Asian subcontinent</span></p><ol style=\"list-style: unset;\r\n    margin-left: 55px;\"><li>7 million garments </li><li>shipped with 0.023% defect\r\n10,000&nbsp;</li><li>samples developed last year 2,000 styles shipped annually</li></ol>', NULL, '2024-09-15 14:53:52', '2024-09-18 03:01:13'),
(6, 'what_we_do', '<h1 class=\"text-center text-italic\" style=\"margin-right: 0px; margin-left: 0px; font-size: 33px; font-family: Calibri, Helvetica, sans-serif; line-height: 1.2; color: rgb(0, 0, 0);\"><font color=\"#bd9400\"><br></font></h1><h1 class=\"text-center text-italic\" style=\"margin-right: 0px; margin-left: 0px; font-size: 33px; font-family: Calibri, Helvetica, sans-serif; line-height: 1.2; color: rgb(0, 0, 0);\"><font color=\"#bd9400\">What We Do</font></h1><p style=\"margin-right: 0px; margin-left: 0px; font-family: Calibri, Helvetica, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"font-weight: 600;\">We Believe in Quality</span></p><p style=\"margin-right: 0px; margin-left: 0px; font-family: Calibri, Helvetica, sans-serif; font-size: 16px; text-align: justify;\"><span style=\"font-size: 14.98px;\">We want to share with other people. That`s why we ask questions until we are sure of what the customer needs. We do not simply fulfill requests. We think ahead about where fashions are going.&nbsp;</span><span style=\"font-size: 14.98px;\">We offer creative and technical support at every step&nbsp;</span><span style=\"font-size: 14.98px;\">&nbsp;for washes, colors, fabrics, sourcing materials, quality. For fit, design, and product development.</span></p><ul style=\"margin-left: 55px;\"><li style=\"margin-right: 0px; margin-left: 0px; font-family: Calibri, Helvetica, sans-serif; font-size: 16px; text-align: justify;\">Sourcing</li><li style=\"margin-right: 0px; margin-left: 0px; font-family: Calibri, Helvetica, sans-serif; font-size: 16px; text-align: justify;\">Product</li><li style=\"margin-right: 0px; margin-left: 0px; font-family: Calibri, Helvetica, sans-serif; font-size: 16px; text-align: justify;\">Development</li><li style=\"margin-right: 0px; margin-left: 0px; font-family: Calibri, Helvetica, sans-serif; font-size: 16px; text-align: justify;\">Quality Control</li><li style=\"margin-right: 0px; margin-left: 0px; font-family: Calibri, Helvetica, sans-serif; font-size: 16px; text-align: justify;\">Production</li><li style=\"margin-right: 0px; margin-left: 0px; font-family: Calibri, Helvetica, sans-serif; font-size: 16px; text-align: justify;\">Vendor Management</li><li style=\"margin-right: 0px; margin-left: 0px; font-family: Calibri, Helvetica, sans-serif; font-size: 16px; text-align: justify;\">Cost efficiency&nbsp;</li></ul><br>', NULL, '2024-09-15 14:53:52', '2024-09-18 04:19:47');
